const valorOriginal = $('Webhook').item.json.body.valor;
let valorNumerico = parseFloat(valorOriginal.toString().replace(',', '.'));

// Garante que tenha duas casas decimais
let valorFormatado = valorNumerico.toFixed(2).replace('.', ',');

// Verifica se o valor é negativo e formata corretamente
if (valorNumerico < 0) {
    valorFormatado = `R$ (${Math.abs(valorNumerico).toFixed(2).replace('.', ',')})`;
} else {
    valorFormatado = `R$ ${valorFormatado}`;
}

return [{ valorFormatado }];

// Captura o valor retornado no campo "Código"
const codigo = $('HTTP Request1').item.json.results[0]['Código']; 

// Separa a parte da letra e do número usando regex
const match = codigo.match(/^([A-Za-z]+)(\d+)$/);

if (match) {
    const letra = match[1]; // Captura a parte da letra (D, A, B, etc.)
    const numero = parseInt(match[2], 10) + 1; // Captura a parte numérica e soma 1

    return [{ json: { letra, numero } }];
} else {
    return [{ json: { error: "Formato inválido" } }];
}

const tipo = $('Webhook').item.json.body.tipo; 

const resultado = tipo === "Despesa" ? "D" : "R";

return [{ json: { resultado } }];

const inputDate = $('Webhook').item.json.body.data;
const [day, month, year] = inputDate.split('-');
const formattedDate = `${year}-${month}-${day}`;

return [{ json: { formattedDate } }];

const dataAtual = new Date();

// Ajusta para o fuso horário de Brasília (UTC-3 ou UTC-2 no horário de verão)
const dataBrasilia = new Date(dataAtual.toLocaleString("en-US", { timeZone: "America/Sao_Paulo" }));

// Formata a data no padrão YYYY-MM-DD
const dataFormatada = dataBrasilia.toISOString().split('T')[0];

return [{ data: dataFormatada }];

const results = $json.results;

// Verifica se results é um array
if (!Array.isArray(results)) {
    throw new Error("Os dados de entrada não possuem a estrutura esperada.");
}

// Filtra apenas os itens onde "Receita / Despesa" é "Despesa"
const despesas = results.filter(item => item["Receita / Despesa"] === "Despesa");

return despesas;

