const tipo = $('Webhook').item.json.body.tipo; 

const resultado = tipo === "Despesa" ? "D" : "R";

return [{ json: { resultado } }];

// Obtém a data atual no fuso horário de Brasília
const dataBrasilia = new Date(new Date().toLocaleString("en-US", { timeZone: "America/Sao_Paulo" }));

// Formata a data para DD/MM/AAAA
const dia = String(dataBrasilia.getDate()).padStart(2, '0');
const mes = String(dataBrasilia.getMonth() + 1).padStart(2, '0'); // Mês começa do zero
const ano = dataBrasilia.getFullYear();

// Retorna a data formatada
return [{ json: { dataFormatada: `${dia}/${mes}/${ano}` } }];
